import CategoryCell from "./CategoryCell"
import Inputs from "../public/inputs"

function DayCategory(props) {

    const categoryColor = Inputs.categories.map((cat) => cat.name === props.id ? cat.color : null)
    console.log("name", categoryColor)

    return (
        <div>
            <div className="text-xl font-medium">
                {props.id}
            </div>
            <div>
                {props.cells.map((cell) => <CategoryCell key={cell} id={cell}/> )}
            </div>
        </div>
    )
}

export default DayCategory
